import React from 'react';
import { StyledMenu, NormalNavbar } from './Menu.styled';
import Link from 'next/link'
import { MoonIcon, SunIcon, WorldIcon } from '../Icons/ThemeIcon'


// <StyledMenu open={open}>
//     {renderItems}
// </StyledMenu>

const Menu = ({ children, open }) => {
  const renderItems = children.map((x,i) => 
    <div className="divv" key={i}>
      {x}
    </div>
  )

  return (
    <NormalNavbar>
      { 
        open ? <StyledMenu>{renderItems}</StyledMenu> : renderItems
      }
    </NormalNavbar>
  )
}
export default Menu
